// React
import React, { useState } from "react";
import MenuCollections from "./MenuCollections";
import MenuInstallations from "./MenuInstallations";

function Home({
  splashImages,
  collections,
  dateCollections,
  installations,
  isLoading,
}) {
  const [toggle, setToggle] = useState("collection");

  return (
    <div
      style={{
        display: "flex",
        position: "absolute",
        top: "64px",
        left: "0px",
        right: "0px",
        bottom: "64px",
        padding: "32px",
        overflow: "hidden",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          width: "100%",
          maxWidth: "1600px",
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-between",
          gap: "200px",
        }}
      >
        <div>
          <MenuCollections
            collections={collections}
            dateCollections={dateCollections}
            isLoading={isLoading}
          />
          <MenuInstallations
            installations={installations}
            isLoading={isLoading}
          />
        </div>
        {splashImages && splashImages[0] && (
          <img
            src={splashImages[0].url}
            style={{
              flex: 1,
              objectFit: "cover",
            }}
          ></img>
        )}
      </div>
    </div>
  );
}

export default Home;
